import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/navBar';
import Logo from './components/logo';

import './App.css';
function App() {
  return (
    <Router>
    <div className='App'>
      <Logo />
      <Navbar />
    </div>
    </Router>
  );
}

export default App;
